Добро пожаловать! Меня зовут Буянов Николай.
⚕Я работаю врачом неврологом, реабилитологом, иглорефлексотерапевтом, мануальным терапевтом и прикладным кинезиологом.
В работе с пациентом я всегда выбираю те методы лечения и коррекции, которые будут для него наиболее эффективны.

Диагностика:
🔰Мануальное мышечное тестирование;
🔰Диагностика канально-меридианных нарушений;
🔰Тесты на активность примитивных вегетативных  рефлексов;
🔰Выявление психосоматических реакций.

Методы лечения:
🔰Мануальные и остеопатические техники;
🔰Кинезиотейпироване, кросстейпинг;
🔰Иглорефлексотерапия;
🔰Коррекция психосоматических реакций;
🔰ЛФК;
🔰Детоксикация и медикаментозная терапия;
